import React, { Fragment } from "react";

import "./MainSection.css";

import NavigationBar from "../../components/NavigationBar/NavigationBar";

import wildfire from "../../assets/wildfire1.jpg";

const MainSection = () => {
  return (
    <Fragment>
      <div className="bg">
        <div id="main-section">
          <NavigationBar />
          <div className="center-text">
            <div className="allert">ALLERT</div>
            <div className="slog">forewarned is forearmed</div>
          </div>
        </div>
      </div>
    </Fragment>
  );
};

export default MainSection;
